import React from "react";
import { Routes } from "react-router-dom";

const App = () => {
  return (
    <div>
      <h1 className="text-green-600 text-3xl font-bold"> Cart </h1>
      <Routes>
        <Route path="/" element="" />
      </Routes>
    </div>
  );
};

export default App;
